import React from 'react'
import  { useState, useEffect } from 'react';
import axios from 'axios';
import { makeStyles } from '@material-ui/core/styles';
import Divider from '@material-ui/core/Divider';
import Paper from '@material-ui/core/Paper';

const useStyles = makeStyles(theme=>({
  paper:{
    padding: theme.spacing(4,1),
  },
  root: {
    color: 'black',
    textAlign: 'center',
    fontSize: 30,
    marginTop:30,
  },
  content: {
    padding:'5px 200px 10px 20px',
    width: '100%',
    height: 'auto',
    textAlign: 'justify',
    fontSize: 15,

  },
  subheading: {
    paddingLeft: '40px',
    width: '100%',
    height: 'auto',
    textAlign: 'justify',
    fontSize: 23,
    color: '#4f5751'
  },
  list: {
    paddingLeft:'80px',
    paddingRight:'40px',
    width: '100%',
    height: 'auto',
    textAlign: 'justify',
    fontSize: 15,
    listStyleType: 'square',
  },
}));


const ReactHome = (props) => {


  const classes = useStyles();

  const [data, setData] = useState({ data: [] });
  useEffect(async () => {
    const result = await axios(
      '/api/react/getLessons',
    );
    setData(result.data);
  }, []);


  return (

    <div>
    <br/>
    {console.log(data)}
      <br/>
      <h2 className={classes.root}></h2>
      <br/>
      <Divider/>
      <br/>



    </div>
  )
}

export default ReactHome
